import React from "react";
import "./Icon.css";

export default function Icon() {
  return (
    <div className="icons">
      <img className="icon-img" alt="pic" src="./img/icon1.png" />

      <img className="icon-img" alt="pic" src="./img/icon2.png" />

      <img className="icon-img" alt="pic" src="./img/icon3.png" />

      <img className="icon-img" alt="pic" src="./img/icon4.png" />
      <p className="subtext">Declerative</p>
      <p className="subtext"> Compenants</p>
      <p className="subtext">Single Way</p>
      <p className="subtext">JSX</p>
    </div>
  );
}
